import React from "react";
import styled from "styled-components";

const Logo = styled.div`
  font-size: 1.5rem;
`;
const Bar = styled.div`
  display: grid;
  grid-template-columns: 180px auto 100px 100px;
  padding: 10px;
  background: #1f1b24;
  color: white;
`;

const NavBar = () => {
  return (
    <Bar>
      <div>Logo</div>
      <div></div>
      <div>News</div>
      <div>About</div>
    </Bar>
  );
};

export default NavBar;
